/* Zahlen aus der Aufgabenstellung: */
kof: 16; /*Anzahl Koffer*/
kaef: 3; /*Anzahl Eulenk&#228;fige*/
gep: kof+kaef; /*Anzahl der Gep&#228;ckst&#252;cke insgesamt*/
abt1: 5; /*Anzahl m&#246;glicher Gep&#228;ckst&#252;cke in Abteil 1*/
abt23: 4; /*Anzahl m&#246;glicher Gep&#228;ckst&#252;cke jeweils in Abteilen 2 und 3*/
abt45: 3; /*Anzahl m&#246;glicher Gep&#228;ckst&#252;cke jeweils in Abteilen 4 und 5*/
abt: abt1+2*abt23+2*abt45; /*Anzahl aller freien Gep&#228;ck-Pl&#228;tze*/

/* L&#246;sung der Hauptaufgabe: */
n1: binomial(abt,abt1); 
n2: binomial(abt-abt1, abt23);
n3: binomial(abt-abt1-abt23,abt23);
n4: binomial(abt-abt1-2*abt23,abt45);
n5: binomial(abt-abt1-2*abt23-abt45,abt45);
/*Korrekte Antwort f&#252;r Hauptaufgabe:*/
TA1: n1*n2*n3*n4*n5;

/* Schritt 1a - L&#252;ckentext: */
TA3: abt1;
TA4: gep;
Liste5: [[1,true,"ohne"],[2,false,"mit"]]; /*"ohne" Zur&#252;cklegen*/
Liste6: [[1,true,"ohne"],[2,false,"mit"]]; /*"ohne" Beachtung der Reihenfolge*/

/* Single Choice f&#252;r Schritt 1b: */
Liste7: [
    [1,true," \\(\\binom{n}{k}\\)"],
    [2,false," \\(n^k\\)"],
    [3,false," \\(\\binom{n+k-1}{k}\\)"],
    [4,false," \\(\\frac{n!}{(n-k)!}\\)"]
];
Liste7: random_permutation(Liste7);

/* Zwischenschrritt 1c: */
TA15: matrix([abt],[abt1]);

/* 2. Zwischenschritt: */
TA8: n2;

/* 3. Zwischenschritt: */
TA9: n3;
TA10: n4;
TA11: n5;

/* Weitere Versuche f&#252;r die Hauptaufgabe: */
TA12: TA1;
TA14: TA1;

/* Letzter Zwischenschritt (Multiplikation der n_i): */
Liste13: [
    [1,true," \\(n_1\\cdot n_2\\cdots n_5\\)"],
    [2,false," \\(n_1+n_2+\\dots+n_5\\)"],
    [3,false," \\( \\frac{n_1+n_2+\\dots+n_5 }{5} \\)"],
    [4,false," \\(1 - \\frac{1}{n_1\\cdot n_2\\cdots n_5}\\)"],
    [5,false," \\( \\binom{n_1\\cdot n_2\\cdots n_5}{5}\\)"]
];
Liste13: random_permutation(Liste13);

